import {BrowserRouter} from "react-router-dom";
import Footer from "rc-footer";


const Content = () => {
    return (
        <div>
            <Navbar/>
            <Hero/>
            <CarouselHome/>
            <Footer/>

        </div>
    );
};

export default Content;
